import datetimedef filter_fields(data: dict):    filter_kwargs = {"date__year": data["year"], "date__month": data["month"]}    return filter_kwargsdef check_to_cache(data):    today = datetime.date.today()    filter_time = datetime.date(data["date__year"], data["date__month"], 1)    return today.year > filter_time.year and today.month > filter_time.month